import React from "react";

function PokeList({ pokemon, pokePic }) {
    return (
        <div className="container">
            {pokemon.map(p => (
                <div className="poke-div" key={p.name}>{p.name} <img src={p.sprites} alt="" /></div>
            ))}


        </div>
    )
}

export default PokeList;
